import React from 'react';
import styled from "styled-components";

const Topp =styled.nav`
    background-color: black;

`;


const Text =styled.h1`

    color: white;
`;



const Top = (props) => {
    return (
        <>
            <Topp>
                <Text>{props.text}</Text>

            </Topp>
        </>
    );
};

export default Top;
